import React from 'react';
import '../styles/PropertyList.css';
// Static list of properties
const properties = [
  {
    id: 1,
    name: 'Modern House',
    location: 'San Francisco, CA',
    type: 'House',
    price: 1200000,
    size: 3000,
    bedrooms: 4,
    bathrooms: 3,
  },
  {
    id: 2,
    name: 'Luxury Apartment',
    location: 'New York, NY',
    type: 'Apartment',
    price: 950000,
    size: 2000,
    bedrooms: 3,
    bathrooms: 2,
  },
  {
    id: 3,
    name: 'Beach Condo',
    location: 'Miami, FL',
    type: 'Condo',
    price: 750000,
    size: 1800,
    bedrooms: 2,
    bathrooms: 2,
  },
];

// StaticPropertyList Component
const PropertyListContainer = () => {
  return (
    <div className="static-property-list">
      {properties.map((property) => (
        <div key={property.id} className="property-item">
          <h2>{property.name}</h2>
          <p><strong>Location:</strong> {property.location}</p>
          <p><strong>Type:</strong> {property.type}</p>
          <div className="statistics">
            <div><strong>Price:</strong> ${property.price.toLocaleString()}</div>
            <div><strong>Size:</strong> {property.size} sqft</div>
            <div><strong>Bedrooms:</strong> {property.bedrooms}</div>
            <div><strong>Bathrooms:</strong> {property.bathrooms}</div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default PropertyListContainer;
